export default (function(a,b,c,d,e,f,g,h,i){return {data:{Ec5t1lPYnA:{data:{id:593,attributes:{imdbId:"tt0087050",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDg3OTc2OTQtZDA0My00YTJiLTg3ZTYtOGYwZWM1NWVhZDdiXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"},{Source:"Rotten Tomatoes",Value:"36%"},{Source:"Metacritic",Value:"45\u002F100"}],item_lang:{data:{id:1256,attributes:{title:b,plot:"A boy preacher named Isaac goes to Gatlin, Nebraska and gets all the children to murder every adult in town. A young couple on a road trip stop in Gatlin to report a murder and seek help, but the town seems deserted. They are soon trapped in Gatlin with little chance of getting out alive.",slug:"children-of-the-corn"}}},books:{data:[{id:658,attributes:{title:b,description:d,thumbnail:e,authors:[f],firstBook:true,published:g,publisher:h,subtitle:c}},{id:659,attributes:{title:b,description:d,thumbnail:e,authors:[f],firstBook:a,published:g,publisher:h,subtitle:c}},{id:660,attributes:{title:"The Shape Under the Sheet",description:"This reference source on Stephen King's fiction provides details about characters, places and objects in each of King's novels and short stories and includes a biography section, interviews with family, friends and contemporaries, and sections on film adaptations and audio versions of his work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wHUaAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[i],firstBook:a,published:"1991-01-01",publisher:"Popular Culture Ink",subtitle:"The Complete Stephen King Encyclopedia"}},{id:661,attributes:{title:"Stephen King, American Master",description:"Fascinating facts, trivia, and little-known details about the Master of the Macabre’s life from the “world’s leading authority on Stephen King” (Entertainment Weekly). New York Times–bestselling author Stephen Spignesi has compiled interviews, essays, and loads of facts and details about all of Stephen King’s work into this fun and informative compendium for the author’s many fans, from the casual to the fanatical! Did you know. . . ? In his early teens, Stephen King sold typed copies of his short stories at school. King originally thought his novel Pet Sematary was too frightening to publish. King’s legendary Dark Tower series took him more than 30 years to write. Thinner was the novel that revealed his “Richard Bachman” pseudonym to the world. King wrote The Eyes of the Dragon for his daughter Naomi. He has never liked Stanley Kubrick’s film version of his novel The Shining. It took him four years to write what some consider his magnum opus, IT. The 2017 film version of IT has grossed more than $700 million worldwide. In addition to novels, King has written essays, plays, screenplays, and even poetry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uMhyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Spignesi"],firstBook:a,published:"2018-10-30",publisher:"Permuted Press+ORM",subtitle:"A Creepy Corpus of Facts About Stephen King & His Work"}},{id:662,attributes:{title:"The Stephen King Quiz Book",description:"More than one hundred quizzes and 1,500 questions test readers' knowledge of the works of Stephen King, offering puzzles and questions about the master of horror, his novels, short stories, and films",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ut1MbBSDJ-EC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[i],firstBook:a,published:"1990-01-01",publisher:"Signet Book",subtitle:c}}]}}},meta:{}}},prerenderedAt:1680940942561}}(null,"Children of the Corn","","A Vintage Shorts “Short Story Month” Selection Driving through the cornfields in rural Nebraska, Burt and Vicky run over a young boy—only to discover that they may not be responsible for his death. Out in the corn, something is watching them, and help is nowhere to be found. From the unrivaled master of horror and the supernatural, Stephen King. “Children of the Corn,” first collected in the extraordinary collection Night Shift in 1973 and then adapted into a horror film franchise of the same name, is a terrifying and unforgettable classic of the genre. An eBook short.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FFbgCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","Stephen King","2016-05-22","Vintage","Stephen J. Spignesi"))